import React from 'react';
import User from '../User/User.js';

const UsersList = props => {

    return (
      <ul>
        {props.users.map(user => (
          <User
            key={user.id}
            id={user.id}
          >
            {`${user.username} (${user.age} years old)`}
          </User> ))}
      </ul>
    );
  };

  export default UsersList;
